(1, 'Display Volt Ampere meter digital SOCOMED Buram', 'karena usia barang tersebut (dinstal tahun 2010)', 'kondisi saat ini jika terus dibiarkan tampilan display akan hilang total sehingga mengganggu oprasional monitoring', 'Penggantian Display Volt Ampere meter digital SOCOMED', 'Sudah dilaporkan dan diajukan RAB  untuk QR berikut (update 09/05/2025)', 'Open', 'Power'),
