(3, 'kanopi pelindung crane tidak ada', 'atap gedung tidak dapat mengcover area Crane secara penuh', 'Crane akan cepat rusak jika tidak terlindungi dari cuaca panas maupun hujan', 'Pemasangan kanopi pelindung Crane', 'Sudah dilaporkan dan diajukan RAB  untuk QR berikut (updateupdate  09/05/2025)', 'Open', 'Building '),
