(5, 'Roda Sliding door pada pintu akses  crane patah dan fisik pintu tidak terlalu  tinggi', 'usia Pintu sudah lama (dari tahun 2003)- dan pintu tidak cukup tinggi', 'menghambat proses masuk keluar barang yang menggunakan crane', 'Penggantian pintu Besi akses Crane', 'Sudah dilaporkan dan diajukan RAB  untuk QR berikut (updateupdate  09/05/2025)', 'Open', 'Building '),
(6, 'Autogate sering macet', 'Karena Usia barang tersebut ( diinstal tahun 2004)', 'kondisi ini jika dibiarkan maka autogate akan bertambah kerusakannya dan mengakibatkan akses masuk keluar pintu gerbang menjadi terganggu', 'Penggantian autoGate motor sliding  door', 'Sudah dilaporkan dan diajukan RAB  untuk QR berikut (updateupdate  09/05/2025)', 'Open', 'Power'),
